I. Any of the Fair Folk who wish to become citizens of Winya Ravana are welcome. Citizenship is the right of any elf or fey-kind at peace with the City and the Seldarine.

II. The Inner Sanctum, beyond the footbridge, is to be traveled only by the Fair Folk and those others with Council-approved residency or business in the city.

III. Half-elves and snow elves shall be welcome within the Inner Sanctum, but are not granted citizenship automatically and shall be expelled if disrespectful of elven ways.

IV. Dwarves, hin, gnomes, and humans may freely travel the Outer Sanctum, and may travel the Inner Sanctum with a citizen escort who shall be responsible for their actions.

V. Followers of vile gods, practitioners of dark arts, and members of fallen races such as drow, shadow elves, orc-kind and goblin-kind, unseelie, fiend-bloods, and vile dragon kin may not enter Winya Ravana, nor may their half-blooded or blood-touched progeny.

As I would think, so shall ye;
As I would feel, so shall ye;
As I would do, so shall ye;
As I would not harm, nor shall ye;
As I would, so shall the clan;
As the clan would, so shall I;
As we would, so shall ye.
The People are as one, and
never shall I stray from this, nor shall ye,
for to digress is to diminish you and your People.
